import React from 'react'
import charmander from './images/pokemon/charmander.png'

function PokeCard(){
    return(
    <>
        <div>
            <img src={charmander} alt='This is suposed to be a Pokémon'></img>            
        </div>
        <label> Pokémon</label>
    </>)

}
export default PokeCard;
